import React, { Component } from 'react';
import ActivityItem from './ActivityItem.js'
import ActivityFeedContent from '../ActivityFeedContent.json';

class ActivityFeed extends Component {
	render() {
            return (
		<div id="activity-feed" class="content-wrapper">
		    <h3>Latest Activities</h3>
		    <ActivityItem type={"conference-present-activity"}
				  title={"Talk given at Sheffield SIAM-IMA Conference 2021"}
				  date={"27/7/2021"}
				  content={<p>I gave an online talk about the content of my MRes summer project work titled "Topology optimisation of structural electrolyte microstructures using a topological sensitivity and level-set approach". A recording of the presentation can be found <a href="https://www.youtube.com/watch?v=lrG2Fgy-dtk" target="blank">here</a>.</p>}
		    />
		    <ActivityItem type={"workshop-activity"}
				  title={"Activity 2"}/>
		    {ActivityFeedContent.map((item) => (
			<ActivityItem type={item.type}
				      title={item.title}
				      date={item.date}
				      content={item.content}/>
		    ))}
		</div>
	    );
  	}
}

export default ActivityFeed;
